import React, { useEffect } from "react";

const data = [101, 102, 103, 104];
const Waiting = ({ orderlist }) => {
  const list = data.map(num => {
    return <div>{num}</div>;
  });

  return (
    <div>
      <div>{list}</div>

      <br />
    </div>
  );
};

export default Waiting;
